    false,nt"url": null,nt"notes": "The Disaggregated Futures-Only Commitments
    of Traders dataset provides a breakdown of each week's open interest for agriculture,
    energy, metals, lumber, and emissions futures markets in which 20 or more traders
    hold positions equal to or above the reporting levels established by the CFTC.  Open
    interest is reported separately by reportable and non-reportable positions for Producer/Merchant/Processor/User,
    Swap Dealers, Managed Money. and Other Reportables holdings, including spreading,
    changes from the previous report, percents of open interest by category, and numbers
    of traders.  Agriculture futures market data is also grouped by crop year, where
    appropriate, and shows the concentration of positions held by the largest four and
    eight traders.",nt"license_title": null,nt"extras": [{ntt"key": "data-quality",ntt"value":
